import './App.css';
import axios from "axios";
import { graphQL } from './endpoints';

const getMessage = () => {
  axios.post(graphQL, {
    query: `query getMessages {
      test {
        id
        message
        fecha_creacion
      }
    }    
    `
  })
  .then (response => {    
    console.log("DATA => ", response.data.data)
    return "Success"
  })
  .catch(error=> {
    console.log("Error => ", error)
    return error
  })
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          {getMessage()}
        </div>
      </header>
    </div>
  );
}

export default App;
